import React, {useEffect, useState} from "react";
import axios from "axios";

function Home() {

  useEffect(() => {
    axios.get("http://localhost:3000/")
  }, [])

  return (
    <div>
      <h1>Welcome to the bookstore.</h1>
    </div>
  );
}

export default Home;
